import { ADD_FAVORITE, CLEAR_FAVORITE, REMOVE_FAVORITE } from './type'

export const addCharacter = (data) => {
  console.log('add character', data)
  return {
    type: ADD_FAVORITE,
    data
  }
}

export const removeFavorite = (data) => {
  console.log('remove favorite', data)
  return {
    type: REMOVE_FAVORITE,
    data
  }
}

export const clearFavorite = () => {
  console.log('clear favo')
  return {
    type: CLEAR_FAVORITE,
  }
}
